import { Component, OnInit, OnDestroy, Input } from '@angular/core';
import { HttpHeaders, HttpErrorResponse, HttpResponse } from '@angular/common/http';
import { Subscription } from 'rxjs';
// eslint-disable-next-line @typescript-eslint/no-unused-vars
import { filter, map } from 'rxjs/operators';
import { JhiEventManager, JhiAlertService, JhiParseLinks } from 'ng-jhipster';

import { ITbMovimentacao } from 'app/shared/model/tb-movimentacao.model';
import { AccountService } from 'app/core/auth/account.service';
import { TbMovimentacaoService } from './tb-movimentacao.service';

import { ActivatedRoute, Router } from '@angular/router';
// eslint-disable-next-line @typescript-eslint/no-unused-vars

import { ITEMS_PER_PAGE } from 'app/shared/constants/pagination.constants';
import { ITbProduto, TbProduto } from 'app/shared/model/tb-produto.model';
import { FormBuilder, Validators, FormControl } from '@angular/forms';
import * as moment from 'moment';
import { ValidatorService } from '../validator.service';
//import * as jsPDF from 'jspdf';
require('jspdf-autotable');

@Component({
  selector: 'jhi-tb-movimentacao',
  templateUrl: './tb-movimentacao.component.html'
})
export class TbMovimentacaoComponent implements OnInit, OnDestroy {

  tbMovimentacaos: ITbMovimentacao[];
  relatorio: { nome: string, dataSaldoAnt: Date, saldoAnt: number, entradas: number, saidas: number }[];
  currentAccount: any;
  eventSubscriber: Subscription;
  error: any;
  success: any;
  routeData: any;
  links: any;
  totalItems: any;
  itemsPerPage: any;
  page: any;
  predicate: any;
  previousPage: any;
  reverse: any;
  dataInicio: Date;
  dataFim: Date;
  jsPDF: any;

  editForm = this.form.group({
    dataInicio: ['', [Validators.required]],
    dataFim: ['', Validators.required]
  });

  constructor(
    protected tbMovimentacaoService: TbMovimentacaoService,
    protected jhiAlertService: JhiAlertService,
    protected eventManager: JhiEventManager,
    protected accountService: AccountService,
    protected parseLinks: JhiParseLinks,
    protected activatedRoute: ActivatedRoute,
    protected router: Router,
    private form: FormBuilder,
    protected validatorService: ValidatorService
  ) {
    this.jsPDF = require('jspdf');
    this.itemsPerPage = ITEMS_PER_PAGE;
    this.routeData = this.activatedRoute.data.subscribe(data => {
      this.page = data.pagingParams.page;
      this.previousPage = data.pagingParams.page;
      this.reverse = data.pagingParams.ascending;
      this.predicate = data.pagingParams.predicate;
    });
  }

  ngOnInit() {
    this.loadAll();
    this.accountService.identity().then(account => {
      this.currentAccount = account;
    });
    this.registerChangeInTbMovimentacaos();
    this.iniciaForm();
  }

  naoPreenchido(input) {
    return ValidatorService.naoPreenchido(input);
  }

  dataFutura(input) {
    return ValidatorService.dataFutura(input);
  }

  datasInconsistentes() {
    return ValidatorService.datasInconsistentes(this.dataInicio, this.dataFim);
  }

  iniciaForm() {
    this.editForm.setValue({
      dataInicio: null,
      dataFim: null
    });
  }

  public transformaData() {
    let vet: string[] = this.editForm.get(['dataInicio']).value.split("/");
    this.dataInicio = new Date(vet[2] + "/" + vet[1] + "/" + vet[0]);

    vet = this.editForm.get(['dataFim']).value.split("/");
    this.dataFim = new Date(vet[2] + "/" + vet[1] + "/" + vet[0]);;
  }

  public retornaData(data: Date): string {
    return (data.getUTCDate() < 10 ? "0" + data.getUTCDate() : data.getUTCDate()) + "/" +
      ((data.getUTCMonth() + 1) < 10 ? "0" + (data.getUTCMonth() + 1) : (data.getUTCMonth() + 1)) + "/" +
      data.getUTCFullYear();
  }

  public agrupamento() {
    this.relatorio = [];    
    let existe: boolean;
    let relAtual: { nome: string, dataSaldoAnt: Date, saldoAnt: number, entradas: number, saidas: number };
    this.tbMovimentacaos.forEach(mov => {
      const dataMov = new Date(mov.data.format("YYYY/MM/DD"));
      const valDataMov = dataMov.getTime() + 86400000;
      existe = false;
      if (this.dataFim.getTime() >= valDataMov) {
        this.relatorio.forEach(rel => {

          if (rel.nome === mov.produto.nmProduto) {
            existe = true;
            if (this.dataInicio.getTime() <= valDataMov) {
              rel.entradas += mov.entrada === 1 ? mov.quantidade : 0;
              rel.saidas += mov.entrada === 0 ? mov.quantidade : 0;
              if (valDataMov < rel.dataSaldoAnt.getTime()) {
                rel.dataSaldoAnt = dataMov;
                rel.saldoAnt = mov.saldoAnt;
              } else if (this.dataInicio.getTime() > rel.dataSaldoAnt.getTime()) {
                rel.dataSaldoAnt = dataMov;
                rel.saldoAnt = mov.saldoAnt;
              }
            } else if (valDataMov > rel.dataSaldoAnt.getTime() &&
              valDataMov < this.dataInicio.getTime()) {
              rel.dataSaldoAnt = dataMov;
              rel.saldoAnt = mov.saldoAnt + (mov.entrada === 1 ? mov.quantidade : -1 * mov.quantidade);
            }
          }
        });
        if (!existe) {
          if (this.dataInicio.getTime() <= valDataMov) {
            relAtual = {
              'nome': mov.produto.nmProduto,
              'saldoAnt': mov.saldoAnt,
              'dataSaldoAnt': dataMov,
              'entradas': mov.entrada === 1 ? mov.quantidade : 0,
              'saidas': mov.entrada === 0 ? mov.quantidade : 0
            }
            this.relatorio.push(relAtual);
          } else if (this.dataInicio.getTime() > valDataMov) {
            relAtual = {
              'nome': mov.produto.nmProduto,
              'saldoAnt': mov.saldoAnt + (mov.entrada === 1 ? mov.quantidade : -1 * mov.quantidade),
              'dataSaldoAnt': dataMov,
              'entradas': 0,
              'saidas': 0
            }
            this.relatorio.push(relAtual);
          }
        }
      }
    });

  }

  public criaRelatorio() {
    const tabela: any[] = [];
    for (let index = 0; index < this.relatorio.length; index++) {
      tabela.push(
        {
          'id': (index + 1) + '',
          'nome': this.relatorio[index].nome,
          'saldoAnt': this.relatorio[index].saldoAnt,
          'entradas': this.relatorio[index].entradas + '',
          'saidas': this.relatorio[index].saidas + '',
          'saldoAtual': (this.relatorio[index].saldoAnt + this.relatorio[index].entradas - this.relatorio[index].saidas) + ''
        }
      );
    }
    return tabela;
  }

  public imagemData(): string {
    return "data:image/jpeg;base64,"
  }

  public downloadPDF() {
    this.transformaData();
    if (this.dataInicio.getTime() <= this.dataFim.getTime() && 
    this.dataFim.getTime() <= moment().toDate().getTime()) {
      this.agrupamento();
      const doc = new this.jsPDF();
      //const pageTotal = this.page;

      const imgData = this.imagemData();
      const tabelaRelatorio = this.criaRelatorio();
      const tabelaTH = [{ title: ' Nº ', dataKey: 'id' },
      { title: 'Nome do Produto', dataKey: 'nome' },
      { title: 'Saldo Anterior', dataKey: 'saldoAnt' },
      { title: 'Entradas', dataKey: 'entradas' },
      { title: 'Saídas', dataKey: 'saidas' },
      { title: 'Saldo Atual', dataKey: 'saldoAtual' }];
      const headerFooter = (data) => {
        if (doc.internal.getNumberOfPages() === 1) {
          //header
          doc.setFontSize(20);
          doc.setTextColor(40);
          doc.setFontStyle('normal');
          doc.addImage(imgData, 'JPEG', 0, 0, 51.2, 26, 16);
          doc.text("Relatorio", 90, 20, 0, 10);

          doc.setFontSize(10);
          doc.setTextColor(40);
          doc.setFontStyle('normal');
          doc.text("Emitido em: " + moment().format("DD/MM/YYYY"), 14.5, 32, 0, 10);

          doc.setFontSize(10);
          doc.setTextColor(40);
          doc.setFontStyle('normal');

          doc.text("Periodo: " + this.retornaData(this.dataInicio) + " - " + this.retornaData(this.dataFim), 142, 32, 0, 10);
        }

        //footer
        doc.setFontSize(8);
        doc.setTextColor(40);
        doc.setFontStyle('normal');
        doc.text(185, 288, 'página ' + doc.internal.getNumberOfPages());
      };

      const centralizaTexto = (data) => {
        if (data.column.index !== 1 || data.row.raw.nome === "Nome do Produto") {
          data.cell.styles.halign = 'center';
        }
      };

      //doc.autoTable({ html: '#lista-produtos', theme: 'grid'});
      doc.autoTable(tabelaTH, tabelaRelatorio, {
        didDrawPage: headerFooter,
        startY: doc.internal.getNumberOfPages() > 1 ? doc.autoTableEndPosY() + 0 : 35,
        theme: 'grid',
        rowPageBreak: 'avoid',
        didParseCell: centralizaTexto,
        headStyles: {
          lineWidth: 0.01,
          lineColor: [100, 100, 100]
        },
        bodyStyles: {
          lineWidth: 0.01,
          lineColor: [100, 100, 100]
        }
      });
      doc.save('relatório.pdf');
    } else {
      if (this.datasInconsistentes() === null) {
        alert("A data informada é maior que a data de hoje");
      } else {
        alert("A data de inicio ('" + this.retornaData(this.dataInicio) + "') não pode ser maior que a data final('" + this.retornaData(this.dataFim) + "')");
      }
    }
  }

  updateForm(tbProduto: ITbProduto) {
    this.editForm.patchValue({
      dataInicio: null,
      datafim: null,
    });
  }

  loadAll() {
    this.tbMovimentacaoService
      .query({
        page: this.page - 1,
        size: this.itemsPerPage,
        sort: this.sort()
      }).pipe(
        filter((res: HttpResponse<ITbMovimentacao[]>) => res.ok),
        map((res: HttpResponse<ITbMovimentacao[]>) => res.body)
      )
      .subscribe(
        (res: ITbMovimentacao[]) =>
          this.tbMovimentacaos = res, (res: HttpErrorResponse) => this.onError(res.message)
      );
  }

  loadPage(page: number) {
    if (page !== this.previousPage) {
      this.previousPage = page;
      this.transition();
    }
  }

  transition() {
    this.router.navigate(['/tb-movimentacao'], {
      queryParams: {
        page: this.page,
        size: this.itemsPerPage,
        sort: this.predicate + ',' + (this.reverse ? 'asc' : 'desc')
      }
    });
    this.loadAll();
  }

  clear() {
    this.page = 0;
    this.router.navigate([
      '/tb-movimentacao',
      {
        page: this.page,
        sort: this.predicate + ',' + (this.reverse ? 'asc' : 'desc')
      }
    ]);
    this.loadAll();
  }

  ngOnDestroy() {
    this.eventManager.destroy(this.eventSubscriber);
  }

  trackId(index: number, item: ITbMovimentacao) {
    return item.id;
  }

  registerChangeInTbMovimentacaos() {
    this.eventSubscriber = this.eventManager.subscribe('tbMovimentacaoListModification', response => this.loadAll());
  }

  sort() {
    const result = [this.predicate + ',' + (this.reverse ? 'asc' : 'desc')];
    if (this.predicate !== 'id') {
      result.push('id');
    }
    return result;
  }

  protected paginateTbMovimentacao(data: ITbMovimentacao[], headers: HttpHeaders) {
    this.links = this.parseLinks.parse(headers.get('link'));
    this.totalItems = parseInt(headers.get('X-Total-Count'), 10);
    this.tbMovimentacaos = data;
  }

  protected onError(errorMessage: string) {
    this.jhiAlertService.error(errorMessage, null, null);
  }
}
